script: |
  super -f text -I q12509.spq | sort > q12509.out

inputs:
  - name: q12509.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT - col1 NOT IN ( - + 35, - col0 * + col2, - col1 * - - col0 * col2 * - col1 * + col2, - col1, + - 51 );
  - name: tab0

outputs:
  - name: q12509.out
    data: |
      15	81	47
      87	21	10
      97	1	99
